import { gql } from '@apollo/client';

export const CREATE_CHATBOX_MUTATION = gql`
mutation
    createChatBox( $name1:String,$name2:String){
        createChatBox(name1:$name1,name2:$name2){
            _id
          name
          messages{
                body
                sender{
              name
            }
            }
        }
    }

    
`;
